import { useState } from "react";
import {
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  Button,
  Typography,
  TextField,
  MenuItem,
  Box,
  Grid,
  FormControlLabel,
  Checkbox
} from "@mui/material";
import { useNavigate } from "react-router-dom";

const niveles = [
  "Secundaria incompleta",
  "Secundaria completa",
  "Preuniversitario",
  "Otro"
];

export default function ModalStart({ open, onClose }) {
  const navigate = useNavigate();
  const [form, setForm] = useState({
    nombres: "",
    apellidos: "",
    dni: "",
    nivel: "",
    email: "",
    celular: "",
    terms: false
  });
  const [error, setError] = useState("");

  const handleChange = (e) => {
    const value = e.target.type === 'checkbox' ? e.target.checked : e.target.value;
    setForm({ ...form, [e.target.name]: value });
    setError("");
  };

  const handleStart = () => {
    // Validación
    if (
      !form.nombres ||
      !form.apellidos ||
      !form.dni ||
      !form.nivel ||
      !form.email ||
      !form.celular
    ) {
      setError("Completa todos los campos obligatorios.");
      return;
    }

    if (!form.terms) {
      setError("Debes aceptar las políticas de privacidad.");
      return;
    }

    // Aquí podrías guardar los datos si lo necesitas
    navigate("/test");
  };

  return (
    <Dialog 
      open={open} 
      onClose={onClose}
      maxWidth="sm"
      fullWidth
      PaperProps={{
        sx: {
          borderRadius: 2,
        }
      }}
    >
      <DialogTitle sx={{ 
        backgroundColor: "#1b5e20", 
        color: "white",
        textAlign: 'center',
        py: 2
      }}>
        <Typography variant="h6" fontWeight="bold">
          Test Vocacional Visualizate
        </Typography>
      </DialogTitle>

      <DialogContent sx={{ p: 3 }}>
        <Typography variant="h6" gutterBottom fontWeight="bold" color="#2e7d32" align="center">
          Queremos conocerte
        </Typography>

        <Box component="form" sx={{ mt: 2 }}>
          <Grid container spacing={2}>
            <Grid item xs={12} sm={6}>
              <TextField
                label="Nombres"
                name="nombres"
                value={form.nombres}
                onChange={handleChange}
                required
                fullWidth
                size="small"
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                label="Apellidos"
                name="apellidos"
                value={form.apellidos}
                onChange={handleChange}
                required
                fullWidth
                size="small"
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                label="DNI"
                name="dni"
                value={form.dni}
                onChange={handleChange}
                required
                fullWidth
                size="small"
                inputProps={{ maxLength: 8 }}
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                select
                label="Nivel de estudios"
                name="nivel"
                value={form.nivel}
                onChange={handleChange}
                required
                fullWidth
                size="small"
              >
                {niveles.map((nivel) => (
                  <MenuItem key={nivel} value={nivel}>
                    {nivel}
                  </MenuItem>
                ))}
              </TextField>
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                label="Email"
                name="email"
                value={form.email}
                onChange={handleChange}
                required
                fullWidth
                size="small"
                type="email"
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <TextField
                label="Celular"
                name="celular"
                value={form.celular}
                onChange={handleChange}
                required
                fullWidth
                size="small"
                inputProps={{ maxLength: 9 }}
              />
            </Grid>
          </Grid>

          <FormControlLabel
            control={
              <Checkbox 
                name="terms" 
                checked={form.terms} 
                onChange={handleChange}
                color="success"
              />
            }
            label="Acepto las políticas de privacidad"
            sx={{ mt: 2 }}
          />

          {error && (
            <Typography color="error" variant="body2" sx={{ mt: 1 }}>
              {error}
            </Typography>
          )}
        </Box>
      </DialogContent>

      <DialogActions sx={{ p: 3, pt: 0 }}>
        <Button
          variant="contained"
          onClick={handleStart}
          fullWidth
          sx={{ 
            backgroundColor: "#388e3c",
            color: "white",
            fontWeight: "bold",
            py: 1.5,
            '&:hover': {
              backgroundColor: "#2e7d32",
            }
          }}
        >
          Iniciar Test
        </Button>
      </DialogActions>
    </Dialog>
  );
}
